import React from 'react';
import './Flights.css';

function Flights(props) { 
    let quotes = props.Quotes
    //let places = props.Places
    //let carriers = props.Carriers
   // let curriencies = props.Curriencies

    return(
        <div className="availableFlights">
            <table>
                <thead>
                    <tr>
                        <th>Price</th>
                        <th>Date</th>
                    </tr>
                </thead>
                <tbody>
                    {props.quotes != null ? (
                    props.quotes.map((quote) => {
                    return (
                        <tr id={"tableinput"} key={quote.QuoteId}>
                         <th>{quote.MinPrice}</th>
                        <th>{quote.QuoteDateTime}</th>
                    </tr>
                    );
                })
                ) : (
                    <div>No results available.</div>
          )}
        </tbody>
      </table>
    </div>
  );
}

export default Flights;
